import axios from 'axios';

function Cohort_infoComponent(props) {
    // {Cohort_info,project_info}

    const [response, setResponse] = useState([])

    useEffect(()=> {
      axios.post('http://127.0.0.1:5000/cohorts/'+props.cohortInfoReq+'/projects/'+props.projectInfoReq,{ 
        "name" : "Proj ENIGMA3 Cortical GWAS",
        "endpoint_id" : "https://enigma-endpoint.disk.isi.edu/enigma_dev/sparql"
    })
      .then((res)=> {
        // console.log(res.data)
          setResponse(res.data);
        });
    });
    

        console.log(props)
    return (
        <div>
        </div>
      );
}


export default Cohort_infoComponent;
